import numpy as np
import matplotlib.pyplot as plt
#from mpl_toolkits.mplot3d import Axes3D
#______________________________________________________________________________
def Normalize(arr):
  norm = (arr-np.min(arr))/(np.max(arr)-np.min(arr))
  return norm
#______________________________________________________________________________
def PlotDat_9_49(z, title):
  fig = plt.figure()
  ax = fig.add_subplot(111, projection='3d')
  y1 = np.full(50,range(50))
  z = Normalize(z)
  z1 = z[0:50]
  z2 = z[50:100]
  z3 = z[100:150]
  z4 = z[150:200]
  z5 = z[200:250]
  z6 = z[250:300]
  z7 = z[300:350]
  z8 = z[350:400]
  z9 = z[400:450]
  z10= z[450:500]
  
  ax.plot(np.full(50,0),y1,z1)
  ax.plot(np.full(50,1),y1,z2)
  ax.plot(np.full(50,2),y1,z3)
  ax.plot(np.full(50,3),y1,z4)
  ax.plot(np.full(50,4),y1,z5)
  ax.plot(np.full(50,5),y1,z6)
  ax.plot(np.full(50,6),y1,z7)
  ax.plot(np.full(50,7),y1,z8)
  ax.plot(np.full(50,8),y1,z9)
  ax.plot(np.full(50,9),y1,z10)

  ax.set_xlabel("tRP1 as asm NOPs")
  ax.set_ylabel("tRP2 as asm NOPs")
  ax.set_zlabel("Error freq")
  ax.set_title(title)
  plt.show()
